INSERT INTO `ybylfw_zlxm` VALUES ('f11040000100', '院前急救费', '指入院前的120急救或现场急救，含诊查、治疗、监护、护理、氧气、材料费等', '限于危重病人的现场抢救（包括脏器功能衰竭、外伤、烧伤、中毒、窒息休克等），除救护车费外，不得收取其他任何费用', '甲', '');
INSERT INTO `ybylfw_zlxm` VALUES ('f11040000101', '院前急救费（一般急救病人）', '指入院前的120急救或现场急救，含诊查、治疗、监护、护理、氧气、材料费等', '除救护车费外，不得收取其他任何费用', '甲', '');
