INSERT INTO `ybylfw_zlxm` VALUES ('f11090000300', '中心监护病房床位费（14日内）', '指配有中心监护台、心电监护仪及其它监护抢救设施,符合ICU、CCU标准的单人或多人监护病房，相对封闭管理', '', '乙', '限以下适应证之一的危重病人:①各种原因引起的急性器官功能衰竭；②严重创伤，各种复杂大手术术后及列入支付范围的器官移植术后需要监测器官功能者；③心脏复苏后；④严重水电解质紊乱及酸碱平衡失调者。');
INSERT INTO `ybylfw_zlxm` VALUES ('f11090000301', '中心监护病房床位费（15-60日）', '指配有中心监护台、心电监护仪及其它监护抢救设施,符合ICU、CCU标准的单人或多人监护病房，相对封闭管理', '', '乙', '限以下适应证之一的危重病人:①各种原因引起的急性器官功能衰竭；②严重创伤，各种复杂大手术术后及列入支付范围的器官移植术后需要监测器官功能者；③心脏复苏后；④严重水电解质紊乱及酸碱平衡失调者。');
INSERT INTO `ybylfw_zlxm` VALUES ('f11090000400', '特殊防护病房床位费', '指核素内照射治疗专用病房、法定甲类传染病隔离病房、烧伤隔离病房 ', '', '甲', '');
